import React from "react";
import {
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardActions,
  Button,
  Box,
} from "@material-ui/core";
import { LogoLink } from "../components/logo/LogoLink";
import { ThemeToggle } from "../components/theme/ThemeToggle";
import { FooterText } from "../components/footer/FooterText";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  root: {
    minHeight: "100vh",
    display: "flex",
    flexDirection: "column",
    paddingTop: theme.spacing(8),
    paddingBottom: theme.spacing(4),
  },
  card: {
    height: "100%",
    display: "flex",
    flexDirection: "column",
    transition: "transform 0.3s ease, box-shadow 0.3s ease",
    "&:hover": {
      transform: "translateY(-5px)",
      boxShadow: theme.shadows[8],
    },
  },
  cardContent: {
    flexGrow: 1,
  },
  header: {
    marginBottom: theme.spacing(4),
  },
}));

// Sample projects data - replace with your actual projects
const projects = [
  {
    id: 1,
    title: "Project One",
    description:
      "A full-stack web application built with React and Node.js. Features include user authentication, real-time data updates, and responsive design.",
    technologies: ["React", "Node.js", "MongoDB"],
    link: "#",
    github: "#",
  },
  {
    id: 2,
    title: "Project Two",
    description:
      "Mobile-first progressive web app with advanced features. Implements modern web technologies for optimal performance.",
    technologies: ["React", "PWA", "Material-UI"],
    link: "#",
    github: "#",
  },
  {
    id: 3,
    title: "Project Three",
    description:
      "E-commerce platform with payment integration. Includes shopping cart, product management, and order tracking.",
    technologies: ["Next.js", "Stripe", "PostgreSQL"],
    link: "#",
    github: "#",
  },
];

export const Projects = () => {
  const classes = useStyles();

  return (
    <>
      <LogoLink />
      <ThemeToggle />
      <Container className={classes.root} maxWidth="lg">
        <Box className={classes.header}>
          <Typography variant="h2" component="h1" gutterBottom>
            Projects
          </Typography>
          <Typography variant="h6" color="textSecondary">
            A showcase of my work and contributions
          </Typography>
        </Box>

        <Grid container spacing={4}>
          {projects.map((project) => (
            <Grid item key={project.id} xs={12} sm={6} md={4}>
              <Card className={classes.card}>
                <CardContent className={classes.cardContent}>
                  <Typography variant="h5" component="h2" gutterBottom>
                    {project.title}
                  </Typography>
                  <Typography variant="body2" color="textSecondary" paragraph>
                    {project.description}
                  </Typography>
                  <Box mt={2}>
                    {project.technologies.map((tech, index) => (
                      <Typography
                        key={index}
                        variant="caption"
                        component="span"
                        style={{ marginRight: 8 }}
                      >
                        #{tech}
                      </Typography>
                    ))}
                  </Box>
                </CardContent>
                <CardActions>
                  <Button size="small" color="primary" href={project.link}>
                    View Live
                  </Button>
                  <Button size="small" color="primary" href={project.github}>
                    GitHub
                  </Button>
                </CardActions>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
      <FooterText />
    </>
  );
};

export default Projects;
